Conjugated polymers and copolymers with strong luminescent properties and balanced charge transporting/injection properties are disclosed. Methods of manufacturing such polymers and copolymers and optoelectronic devices fabricated with such polymers and copolymers are disclosed. A conjugated luminescent polymer with tunable charge transport is prepared according to the following polymerization reaction: 

mM1nM2(M1) _{ m } (M2) _{ n } 

wherein M1 is a monomer having at least two reactive functional groups and at least one chemically bonded charge transporting chromophore group possessing electron-withdrawing character and M2 is a monomer having at least two reactive functional groups and at least one chemically bonded charge transporting chromophore group possessing electron-donating character, wherein m and n are stoichiometric quantities of the monomers M1 and M2, respectively, wherein m and n are varied to tune the charge transport property of the conjugated luminescent polymer. The monomers may include aryl, substituted aryl, and/or multiple carbon double bonds so that when polymerized, the resulting polymer has a conjugated backbone. Additional monomer reactants (M3, M4, M5, etc.) can be used in the polymerization reaction. The stoichiometric monomer amounts are varied to tune the charge transport or other electronic properties of the resulting conjugated luminescent polymer.

A method of manufacturing a magnetic recording medium comprises sequential steps of: 

(a) providing an apparatus for manufacturing the medium; 

(b) supplying the apparatus with a substrate for the medium; 

(c) forming a magnetic recording layer on the substrate in a first portion of the apparatus; 

(d) treating the magnetic recording layer with oxygen gas in a second portion of the apparatus at a sub-atmospheric pressure and for an interval sufficient to provide the resultant medium with at least one of the following, relative to a similar medium manufactured by a similar method but wherein the oxygen treatment of step (d) is not performed: 

 (i) a more negative nucleation field (H ₙ ); 

 (ii) increased remanent squareness (S _{r} ); 

(iii) increased signal-to-medium noise ratio (SMNR); 

(iv) narrower switching field distribution (SFD); and 

(v) decreased thermal decay rate; and 

(e) forming a protective overcoat layer on the oxygen-treated magnetic recording layer in a third portion of the apparatus.

A compound having a host moiety chemically bonded to at least one guest moiety according to the following general molecular structure: 

 H ₒ -(L-G) _{n. } 

 H ₒ represents a host moiety that receives hole and/or electron recombination energy and transfers that energy to a guest moiety; G represents a guest moiety that contains a luminescent chromophore; L represents a chemical moiety that links the host and guest moiety and n is from 1 to 4. The compound can be used in the emissive layer of an OLED, or as a dopant dispersed in a host material that forms the emissive layer, wherein the host material has the same chemical structure as H ₒ .

A compound having a host moiety chemically bonded to at least one guest moiety according to the following general molecular structure: 

H _{ o } (LG) _{ n. } 

H _{ o } represents a host moiety that receives hole and/or electron recombination energy and transfers that energy to a guest moiety; G represents a guest moiety that contains a luminescent chromophore; L represents a chemical moiety that links the host and guest moiety and n is from 1 to 4. The compound can be used in the emissive layer of an OLED, or as a dopant dispersed in a host material that forms the emissive layer, wherein the host material has the same chemical structure as H _{ o } .
